// importing mongoose to create models for our datasets
const mongoose = require('mongoose');

// creating schema for our users model
const {Schema} = mongoose;

// creating data model instance
const userSchema = new Schema({
    // name of the user
    name:{
        type: String,
        require: true,
    },

    // User Address
    address:{
        type: String,
        require: true,
        unique: true,
    },
    // User password
    password: {
        type: String,
        require: true,
    },

    // date of creating account 
    date:{
        type: Date,
        default: Date.now
    },
    // List of addresses that followed user
    followers: {
        type: Array,
        default: []
    },
    // List of addresses that user is following currently
    following:{
        type: Array,
        default: []
    },
    // list if the tweeet id liked by the user
    likedTweets: {
        type: Array,
        default: []
    },
    // list of the tweet id's retweeted by the user
    reTweets: {
        type: Array,
        default: []
    },
    // Information about the user.
    aboutUser: {
        type: String,
        default: ""
    },
    // Is profile is VIP or not.
    isVip:{
        type: Boolean,
        default: false
    },
    profileImg:
    {
        type: String,
        default: 'data:image/png;base64,'
    },
    backImage:{
        type:String,
        default: 'data:image/jpeg;base64,'
    }

})
// creating model users
const Users = mongoose.model('user', userSchema);
module.exports = Users;

